import React from "react";
import "./App.css";

class App extends React.Component {
  constructor(){
    super() 
      this.state = {
        schoolData: []
      }

  }
  getSchoolList() {
    fetch(process.env.REACT_APP_API_URL + "/schools")
      .then(res => res.json())
      .then(
        (result) => {
          console.log("API_URL1=>", process.env.REACT_APP_API_URL);          
          console.log("result=>", result);
          this.setState({schoolData: result});
          // this.setState({
          //   isLoaded: true,
          //   items: result.items
          // });
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }

  render() {
    return (
      <table>
      <tbody>{this.state.schoolData.map(function(item, key) {

               return (
                  <tr key = {key}>
                      <td>{item.userId}</td>
                      <td>{item.id}</td>
                      <td>{item.title}</td>
                      <td>{item.body}</td>
                  </tr>
                )

             })}</tbody>
       </table>
    );
  }
}

export default App;
